import React from 'react';
import {Box, Button, ButtonGroup, Flex, Heading, VStack} from "@chakra-ui/react";

const FoundQuiz = () => {
    return (
        <Box bg={'gray.100'} minH={'100vh'}>
         <Flex w={'100%'} align={'center'}>
             <Box flex={3} minW={300} bg={'white'}>
                 dfdf
             </Box>
             <Flex justifyItems={'start'} justifyContent={'start'} flex={7} w={'100%'} direction={'column'}>
                 <Box>
                     <VStack pt={10} spacing={4}>
                         {/*  QUIZ TITLE*/}
                         <Heading>Quiz title</Heading>
                         {/*  ACTION BUTTONS*/}
                         <VStack boxShadow={'md'} p={4} bg={'white'} w={300} minW={'200px'} spacing={4}>
                             <Button w={'100%'} colorScheme={'teal'}>Start</Button>
                             <Button w={'100%'} colorScheme={'blue'}>Share</Button>
                             <Button w={'100%'} colorScheme={'gray'}>Cancel</Button>
                         </VStack>
                         {/*    OPTIONS*/}
                         <Box minW={200} w={300} bg={'white'}>
                             OPTIONs BOX
                         </Box>
                     </VStack>
                 </Box>
             </Flex>
         </Flex>
        </Box>
    );
};

export default FoundQuiz;
